import "./App.css";
import { Routes, Route } from "react-router-dom";
import Homepage from "./Mycomponent/Pages/Homepage";
import HomeData from "./Mycomponent/Pages/HomeData";

function App() {
  return (
    <div className="App">
      <Routes>
        <Route exact path="/" element={<Homepage />} />
        <Route path="" element={<HomeData />} />
      </Routes>
    </div>
  );
}

export default App;
